const Project = ({github, projmanage, image, description}) => {
    return ( 
        <div className="flex w-[240px] h-[300px] bg-[#30323d]">
            <image src="./src/img2.png"></image>
            <div className="w-full h-full flex justify-evenly">
            <button onClick={() =>  window.open("https://www.google.com")}>Code</button>
            <button>Demo</button>
            </div>
            <div className="h-full w-ful"></div>
        </div>
     );
}

export default Project;
